protected void indent(EnumSet<EOpt> opts) {
  if (opts.contains(INLINE) && wasInline) {
    return;
  }
  if (wasInline) {
    out.println();
  }
  wasInline = opts.contains(INLINE) || opts.contains(PRE);
  for (int i = 0; i < nestLevel; ++i) {
    out.print(INDENT_CHARS);
  }
  ++indents;
}
